import React from 'react';
import './InputField.css';
const InputField = () => {
    return (
        <>
            <div>
                <h1>Hello</h1>
                <input type="text" placeholder="Enter your Name" />
                <button>Click Me 🔐</button>
            </div>
        </>
    );
}

export default InputField;
